import React from "react";
import "./Sidebar.css";

function Sidebar({ repos, onAddRepo }) {
    return (
        <div className="sidebar">
            <h2>Repositories</h2>
            <ul>
                {repos.map((repo, index) => (
                    <li key={index}>{repo}</li>
                ))}
            </ul>
            <button onClick={onAddRepo}>Add Repo</button>
        </div>
    );
}

export default Sidebar;
